import React from 'react';
import {Link} from 'react-router-dom'

const Header = () => {
    return (
        <div className='header_container'>
            <div className="name_logo_text">TODO</div>
            <div className="butons">
            <Link to="/" className="btn">ToDo</Link>
            <Link to="/allToDo" className="btn">AllToDo</Link>
            </div>
        </div>
    );
}

export default Header;
